import React, { useState } from "react";
import MainHeader from "./mainHeader";
import Cards from "./cards";

interface MainProps {
  IDs: number[];
}

function Main(props: MainProps) {
  const [page, setPage] = useState(1);

  return (
    <div className="main">
      <MainHeader num={props.IDs.length} />
      <Cards IDs={props.IDs} page={page} />
      <div className="pages">
        <button
          className="page1"
          style={page === 1 ? "color: orangered" : ""}
          onClick={() => setPage(1)}
        >
          1
        </button>
        <button
          className="page2"
          style={page === 2 ? "color: orangered" : ""}
          onClick={() => setPage(2)}
        >
          2
        </button>
        <button
          className="page3"
          style={page === 3 ? "color: orangered" : ""}
          onClick={() => setPage(3)}
        >
          3
        </button>
      </div>
    </div>
  );
}

export default Main;
